import { useState } from 'react'
import axios from "axios";
import { useNavigate} from 'react-router-dom';
const AddProduct = () => {
    const [place, setPlace] = useState('');
    const [days, setDays] = useState('');
    const [pack, setPack] = useState('');
    const [covid_restrictions, setCovid_restrictions] = useState('');
    const [temperature, setTemperature] = useState('');
    const navigate = useNavigate();
    const saveProduct = async (e) => {
        e.preventDefault();
        await axios.post('http://localhost:8181/',{
          place: place,
          days:days,
          pack:pack,
          covid_restrictions:covid_restrictions,
          temperature:temperature
        });
        navigate("/");
    }
 
    return (
        <div>
            <form onSubmit={ saveProduct }>
 
                <div className="field">
                    <label className="label">PLACE</label>
                    <input 
                        className="input"
                        type="text"
                        placeholder="place"
                        value={ place }
                        pattern="[a-zA-Z]{2,}" required
                        onChange={ (e) => setPlace(e.target.value) }
                    />
                </div>
                <div className="field">
                    <label className="label">DAYS</label>
                    <input 
                        className="input"
                        type="text"
                        placeholder="days"
                        value={ days }
                        min="1"
                        max="100"
                        inputMode='numeric'
                        title="choose 1-100 days"
                        onChange={ (e) => setDays(e.target.value) }
                    />
                </div>
                <div className="field">
                    <label className="label">PACK</label>
                    <input 
                        className="input"
                        type="text"
                        placeholder="pack"
                        value={ pack }
                        min="1000"
                        max="100000"
                        inputMode='numeric'
                        onChange={ (e) => setPack(e.target.value) }
                    />
                </div>
                <div className="field">
                    <label className="label">COVID_RESTRICTIONS</label>
                    <select id="country" name="country">
      <option value="">Australia</option>
      <option value="canada">Canada</option>
      
    </select>
                   
                   
                   
                    <input 
                        className="input"
                       
                        placeholder="covid_restrictions"
                        value={ covid_restrictions }
                        onChange={ (e) => setCovid_restrictions(e.target.value)}
                       
                    />
                   
                 {/* <select name="select" id="select">
                    <option value="Yes">Yes</option>
                    <option value="No">No</option>
                </select> */}

                </div>
                <div className="field">
                    <label className="label">TEMPERATURE</label>
                    <input 
                        className="input"
                        type="text"
                        placeholder="temperature"
                        value={ temperature }
                        min="1"
                        max="60"
                        inputMode='numeric'
                        onChange={ (e) => setTemperature(e.target.value) }
                    />
                </div>
                <div className="field">
                    <button className="button is-primary">Save</button>
                </div>
            </form>
        </div>
    )
}
 
export default AddProduct
